const AddUser = (props) => {
    return (
        <form>
            <label htmlFor="username">User Name:</label>
            <input id="username" type="text" id='username'></input>
            <label htmlFor="age">Age (Years):</label>
            <input id="age" type="text" id='username'></input>
        </form>)
}



export default AddUser;
